import numpy as np
import matplotlib.pyplot as plt

from skimage.io import imread

orig_img = imread('https://hips.hearstapps.com/hmg-prod/images/actress-zendaya-poses-for-a-photocall-at-the-louis-vuitton-news-photo-1693757973.jpg?crop=1xw:0.375xh;center,top&resize=1200:*')

res = orig_img.copy()
x_min = 100
x_max = 600
y_min = 400
y_max = 800
h = 10
h_x = (x_max - x_min) // h
h_y = (y_max - y_min) // h
h_sum = (h_x * h_y)
for x in range(x_min,x_max,h_x):
  for y in range(y_min,y_max,h_y):
    for i in range(0,3):
      res[x:x+h_x,y:y+h_y,i] = np.sum(orig_img[x:x+h_x,y:y+h_y,i]) / h_sum
plt.imshow(res)
plt.show()